74604.png',1,1,2,NULL,NULL,NULL,NULL),(212,'Tarjeta Relé de 8 Canales Optoacoplados','<p>Sin descripci&oacute;n</p>\r\n','2020-11-19','2021-04-28 17:47:28',89,1,12,5,78,1,4,12,'212U4SU12T5ST77','product_template_21907-20210428174728.png',1,1,2,NULL,NULL,NULL,NULL),(213,'Regulador Voltaje Step Down LM2596 DC-DC','<p>Este circuito te permite tener un voltaje regulado a partir de una fuente de alimentaci&oacute;n con un voltaje mayor para el uso con&nbsp;microcontroladores, Arduino, PICs, Raspberry Pi,&nbsp;fuentes variables, drivers para leds, etc.</p>\r\n\r\n<p>Este dispositivo est&aacute; disponible con voltaje de salida ajustable. El m&oacute;dulo reduce al m&iacute;nimo el uso de componentes externos para simplificar el dise&ntilde;o de fuentes de alimentaci&oacute;n.</p>\r\n','2020-11-19','2021-04-28 16:29:57',34,1,12,5,78,1,4,12,'213U4SU12T5ST77','modulo-lm2596-reductor-voltaje-ajustable-step-down-20210428162715.jpg',1,1,2,NULL,NULL,NULL,NULL),(214,'Tarjeta OCEA TMOV-02 VT-102','<p>Sin descripci&oacute;n</p>\r\n','2020-11-19','2021-04-28 17:43:54',0,0,12,5,78,1,4,14,'214U4SU12T5ST77','no-image.png',1,1,2,NULL,NULL,NULL,NULL),(215,'M�dulo Ethernet ENC28J60','<p>El m&oacute;dulo de Ethernet ENC28J60 utiliza el nuevo microchip Controlador de Ethernet aut&oacute;nomo ENC28J60 con una serie de caracter&iacute;sticas para manejar la mayor&iacute;a de los requisitos de protocolo de red. La placa se conecta directamente a la mayor&iacute;a de los microcontroladores ( PIC, Arduino, AVR, DSP, STM32, 8051, etc ) con una interfaz SPI est&aacute;ndar con una velocidad de transferencia de hasta 20 MHz.</p>\r\n\r\n<p>Se trata de un m&oacute;dulo mediante el cual usted puede poner su tarjeta de control en l&iacute;nea.&nbsp;</p>\r\n','2020-11-19','2021-04-27 19:19:39',1,0,12,5,78,1,4,14,'215U4SU12T5ST77','enc28j60-modulo-ethernet-lan-network-arduino-shield-pic-avr-20210427191939.jpg',1,1,2,NULL,NULL,NULL,NULL),(216,'M?dulo Transmisor/Receptor RF 433Mhz (500Mts) HAC-UM96','<p>Este peque&ntilde;o radio modem utiliza una interfaz serial. Lo que sea que entre por el pin TX a 9600bps es recibido en el pin RX de la otra unidad. Todo el bufferig y la detecci&oacute;n de errores es manejada internamente. Esta unidad puede ser conectada a niveles TTL (para microcontroladores) o directamente a una interfaz RS232/RS485.</p>\r\n\r\n<p>Caracter&iacute;sticas: Transmisi&oacute;n confiable a distancias de 500m con rango visual.&nbsp;Frecuencia portadora 430~434Mhz.&nbsp;</p>\r\n\r\n<p>Aplicaciones: Medici&oacute;n de se&ntilde;ales como gas, agua, electricidad en zonas residenciales.&nbsp;Control remoto de sistemas de aire acondicionado. Sistemas de alarmas. Sistemas de sensores inal&aacute;mbricos.&nbsp;Dom&oacute;tica.</p>\r\n','2020-11-19','2021-04-28 11:16:12',4,1,12,5,78,1,4,14,'216U4SU12T5ST77','modulo2-20210428111113.png',1,1,2,NULL,NULL,NULL,NULL),(217,'Modulo Transmisor/Receptor RF 433Mhz (2000Mts) HAC-LM96','<p>Este peque&ntilde;o radio modem utiliza una interfaz serial. Lo que sea que entre por el pin TX a 9600bps es recibido en el pin RX de la otra unidad. Todo el bufferig y la detecci&oacute;n de errores es manejada internamente. Esta unidad puede ser conectada a niveles TTL (para microcontroladores) o directamente a una interfaz RS232/RS485.</p>\r\n\r\n<p>Caracter&iacute;sticas: Transmisi&oacute;n confiable a distancias de 2000m con rango visual.&nbsp;Frecuencia portadora 430~434Mhz.&nbsp;</p>\r\n\r\n<p>Aplicaciones: Medici&oacute;n de se&ntilde;ales como gas, agua, electricidad en zonas residenciales.&nbsp;Control remoto de sistemas de aire acondicionado. Sistemas de alarmas. Sistemas de sensores inal&aacute;mbricos.&nbsp;Dom&oacute;tica.</p>\r\n','2020-11-19','2021-07-06 17:54:43',1,0,12,5,78,1,4,12,'217U4SU12T5ST77','modulo1-20210428095041.jpg',1,1,2,NULL,NULL,NULL,NULL),(218,'XBee 900 Pro XSC RPSMA','<p>Sin descripci&oacute;n</p>\r\n','2020-11-19','2021-04-29 14:37:25',0,0,12,5,78,1,4,14,'218U4SU12T5ST77','no-image.png',1,1,2,NULL,NULL