,10,2,21,6,89,1,4,4,'390U4SU4T6ST89','anydesk-20210706173048.png'),(101,'Modulo Transmisor/Receptor RF 433Mhz (2000Mts) HAC-LM96','<p>Este peque&ntilde;o radio modem utiliza una interfaz serial. Lo que sea que entre por el pin TX a 9600bps es recibido en el pin RX de la otra unidad. Todo el bufferig y la detecci&oacute;n de errores es manejada internamente. Esta unidad puede ser conectada a niveles TTL (para microcontroladores) o directamente a una interfaz RS232/RS485.</p>\r\n\r\n<p>Caracter&iacute;sticas: Transmisi&oacute;n confiable a distancias de 2000m con rango visual.&nbsp;Frecuencia portadora 430~434Mhz.&nbsp;</p>\r\n\r\n<p>Aplicaciones: Medici&oacute;n de se&ntilde;ales como gas, agua, electricidad en zonas residenciales.&nbsp;Control remoto de sistemas de aire acondicionado. Sistemas de alarmas. Sistemas de sensores inal&aacute;mbricos.&nbsp;Dom&oacute;tica.</p>\r\n','2021-07-06','2021-07-06 17:54:43',1,0,21,5,77,1,4,12,'217U4SU12T5ST77','modulo1-20210428095041.jpg'),(102,'Hilo Metrico M6 Acero Inoxidable 1m','<p>Para montaje de fuentes y regulador LR</p>\r\n','2021-07-06','2021-07-06 17:56:57',470,1,21,5,78,1,4,45,'157U4SU45T5ST78','images-20210427170217.jpeg'),(103,'RC MACHO VOLANTE','<p>sds</p>\r\n','2021-07-06','2021-07-06 18:06:11',31,10,20,5,81,1,4,16,'393U4SU16T5ST81','no-image.png'),(104,'Adaptador Universal de PIN de Tierra','<p>sds</p>\r\n','2021-07-06','2021-07-06 18:08:35',17,1,20,5,81,1,4,40,'394U4SU40T5ST81','no-image.png'),(105,'Adaptador UPS Universal','<p>sds</p>\r\n','2021-07-06','2021-07-06 18:16:02',17,1,20,5,81,1,4,40,'395U4SU40T5ST81','no-image.png'),(106,'Adaptador Universal de PIN de Tierra','<p>sds</p>\r\n','2021-07-06','2021-07-06 18:17:42',17,1,20,5,81,1,4,40,'393U4SU40T5ST81','Adaptador PIN-20210706181742.jpeg'),(107,'Adaptador UPS Universal','<p>sds</p>\r\n','2021-07-06','2021-07-06 18:18:45',17,1,20,5,81,1,4,40,'394U4SU40T5ST81','Adaptador UPS-20210706181845.jpeg'),(108,'RC MACHO VOLANTE','<p>sds</p>\r\n','2021-07-06','2021-07